import React from 'react';
import { IonHeader, IonContent, IonToolbar, IonTitle, IonButton } from '@ionic/react';

const Courses: React.FC = () => {
  return (
    <React.Fragment>
      <IonHeader>
        <IonToolbar>
          <IonTitle>
            Courses
          </IonTitle>
        </IonToolbar>
      </IonHeader>
      <IonContent>
        <h2>This works - courses page!</h2>
        <div>
          <IonButton routerLink="/course-goals">To Course Goals</IonButton>
        </div>
      </IonContent>
    </React.Fragment>
  );
};

export default Courses;
